import React, { Component } from 'react';

export default  class AboutMe extends Component {
  render() {
    return (
        <div id="contact-wrapper">
            <div id="About-me-container">
                <h1>Alexander Thorn Bøttkjær</h1>
                <p>Hej, jeg hedder Alexander og til dagligt arbejder jeg som træner indenfor forskellige idrætsdecipliner.
                    Jeg synes at sammenhængen mellem psykologi og præstation er utroligt spændende, og jeg synes det er meget interesant
                   at se på hvordan man kan øge ens præstation med et par få men meget effektive mentale øvelser.</p>
                <p>Jeg har en Kandidat i idrætsvidenskab med specialisering indenfor sportspskologi fra Københavns Universitet.
                   Dette har været med til at give mig en dybdegående faglig insigt i mental og fysisk sundhed. 
                   Derudover er jeg læreruddannet med fagene, idræt, fysik/kemi, og matematik. Dette trænede mig i at blive bedre til at videreformidle 
                   faglig viden på en sjov og lærerig måde til forskellige målgrupper.</p> 
                <p>Jeg har selv dyrket eliteidræt i 17 år, indenfor svømning, golf, cykelcross og mountainbike. Jeg har dog nogle gange holdt længere
                    pauser og disse 17 år, så jeg ved udemærket godt hvor hårdt det er at skulle i gang igen efter man har fået for mange
                    kg. på sidebenene og hvad der kan hjælpe en til at gøre denne overgang til en sundere livsstil mere behagelig og vedvarende. 
                    Jeg går derfor ikke ind for angiveligt mirakuløse diæter, men jeg mener i stedet at det handler om at indarbejde gode vaner over tid, 
                    hvis man skal holde sin præstation oppe.</p>
                <p>Jeg har arbejdet som holdtræner og personlig coach indenfor cykelcross, spinning, mountainbike, svømning og golf og crossfit.
                   Desuden har jeg arbejdet som mentaltræner for atleterne på det danske landshold i cykelcross.</p>
            </div>
        </div>
    );
  }
}
